function refreshButton() {
//$('.refresh-capthca-btn').prop('disabled', true);
$('.refresh-capthca-btn').addClass('disabled');
}

function copyInput() {
  var inputElems = document.querySelectorAll('.copy-input');
  inputElems.forEach((inputElem) => {
    navigator.clipboard.writeText(inputElem.value);
  });
  Materialize.toast('Copied!', 2000);
}

function errimg() {
$('.ua-check').html('<div class="text-danger font-weight-bold h5 mt-1">Captcha image failed to load.<br><a onclick="location.reload()" style="color:#6270da;cursor:pointer" class="text-decoratione-none">Please refresh the page. <i class="fa fa-refresh"></i></a></div>');
}

if (window.history.replaceState) {
  window.history.replaceState(null, null, window.location.href);
}

$('.remove-spaces').on('input', function() {
  this.value = this.value.replace(/\s/g, '');
});

$(document).on('click', '#toast-container .toast', function() {
  $(this).fadeOut(function() {
    $(this).remove();
  });
});

$('.tktemizle').on('input propertychange', function() {
  var clearAccessToken = $(this).val().match('access_token=(.*?)&');
  if (clearAccessToken) {
    $('.tktemizle').val(clearAccessToken[1]);
  }
});

$(document).ready(function() {
var services=[
    { button: $('.t-followers-button'), menu: $('.t-followers-menu') },
    { button: $('.t-hearts-button'), menu: $('.t-hearts-menu') },
    { button: $('.t-chearts-button'), menu: $('.t-chearts-menu') },
    { button: $('.t-views-button'), menu: $('.t-views-menu') },
    { button: $('.t-shares-button'), menu: $('.t-shares-menu') },
    { button: $('.t-favorites-button'), menu: $('.t-favorites-menu') },
    { button: $('.t-livestream-button'), menu: $('.t-livestream-menu') },
    { button: $('.ig-followers-button'), menu: $('.ig-followers-menu') },
    { button: $('.ig-likes-button'), menu: $('.ig-likes-menu') }
];
$.each(services, function(index, item) {
    item.button.click(function() {
      $('.colsmenu').addClass('nonec');
      item.menu.removeClass('nonec');
    });
  });
});

$(document).ready(function(){
    $(window).scroll(function() {
        if ($(this).scrollTop() > 2000) { 
            $('#scrollToTopBtn').fadeIn();
        } else {
            $('#scrollToTopBtn').fadeOut();
        }
    });

    $('#scrollToTopBtn').click(function() {
        $('html, body').animate({ scrollTop: 0 }, 500);
        return false;
    });
});

$(document).ready(function(){
  $('form').on('submit', function(){
    var btn = $('.submit-captcha')[0];
    if(btn){
      btn.disabled = true;
      if('textContent' in btn) btn.textContent = 'Loading...';
      else if('innerText' in btn) btn.innerText = 'Loading...';
    }
  });
});

var observer = new MutationObserver(function () {
    var selectLimits = document.querySelectorAll(".form-select");

    if (selectLimits.length > 0) {
        selectLimits.forEach(function(selectLimit) {
            if (selectLimit.dataset.processed) return;
            selectLimit.dataset.processed = "true";

            var savedLimit = localStorage.getItem("selectedLimit");
            if (savedLimit) {
                var options = selectLimit.getElementsByTagName('option');
                for (let i = 0; i < options.length; i++) {
                    if (options[i].value === savedLimit) {
                        options[i].selected = true;
                        break;
                    }
                }
            }

            selectLimit.addEventListener("change", function () {
                var selectedValue = selectLimit.value;
                try {
                    localStorage.setItem("selectedLimit", selectedValue);
                } catch (e) {
                    document.cookie = `selectedLimit=${selectedValue}; path=/; max-age=604800`;
                }
            });
        });
    }
});

observer.observe(document.body, {
    childList: true,
    subtree: true,
    attributes: false
});

function setCookie(name, value, days) {
    var date = new Date();
    date.setTime(date.getTime() + days * 24 * 60 * 60 * 1000);
    document.cookie = `${name}=${value};expires=${date.toUTCString()};path=/`;
}

function getCookie(name) {
    var nameEQ = `${name}=`;
    var cookies = document.cookie.split("; ");
    for (let i = 0; i < cookies.length; i++) {
        if (cookies[i].indexOf(nameEQ) === 0) {
            return cookies[i].substring(nameEQ.length);
        }
    }
    return null;
}

